<textarea id=check3textarea>
package Test3PhaseSystemsOverdetermined
    connector Negative3PhasePin
       Modelica.Electrical.Analog.Interfaces.NegativePin p1,p2,p3;
    end Negative3PhasePin;

    connector Positive3PhasePin
       Modelica.Electrical.Analog.Interfaces.PositivePin p1,p2,p3;
    end Positive3PhasePin;

    model Line3Phase
      constant Real pi=Modelica.Constants.pi;
      Positive3PhasePin P;
      Negative3PhasePin N;
      Modelica.Electrical.Analog.Basic.Resistor R1(R=0.5) ;
      Modelica.Electrical.Analog.Basic.Inductor I1(L=1);
      Modelica.Electrical.Analog.Basic.Resistor R2(R=0.5);
      Modelica.Electrical.Analog.Basic.Inductor I2(L=1);
      Modelica.Electrical.Analog.Basic.Resistor R3(R=0.5);
      Modelica.Electrical.Analog.Basic.Inductor I3(L=1);
      Real i_abc[3]={I1.i,I2.i,I3.i};
      Real i_dq0[3];
    protected
      Real theta;
      Real Park[3,3];
    equation
      theta = 2*pi*time;
      Park = sqrt(2)/sqrt(3)*
        [sin(theta), sin(theta+2*pi/3), sin(theta+4*pi/3);
         cos(theta), cos(theta+2*pi/3), cos(theta+4*pi/3);
         1/sqrt(2), 1/sqrt(2), 1/sqrt(2)];
      i_dq0 = Park*i_abc;
      connect(I1.n, R1.p);
      connect(I2.n, R2.p);
      connect(I3.n, R3.p);
      connect(I1.p, P.p1);
      connect(I2.p, P.p2);
      connect(I3.p, P.p3);
      connect(R1.n, N.p1);
      connect(R2.n, N.p2);
      connect(R3.n, N.p3);
    end Line3Phase;

    model Line3PhaseInit
    extends Line3Phase;
    initial equation
      der(i_dq0)={0,0,0};
    end Line3PhaseInit;

    model Source3Phase
      constant Real pi=Modelica.Constants.pi;
      parameter Real shift=0.0;
      Positive3PhasePin P;
      Modelica.Electrical.Analog.Sources.SineVoltage S1(freqHz=1, V=1, phase=shift);
      Modelica.Electrical.Analog.Sources.SineVoltage S2(freqHz=1, V=1, phase=2*pi/3 + shift);
      Modelica.Electrical.Analog.Sources.SineVoltage S3(freqHz=1, V=1, phase=4*pi/3 + shift);
      Modelica.Electrical.Analog.Basic.Ground G;
    equation
      connect(S1.p, P.p1);
      connect(S2.p, P.p2);
      connect(S3.p, P.p3);
      connect(S1.n, G.p);
      connect(S2.n, G.p);
      connect(S3.n, G.p);
    end Source3Phase;

    model Test3PhaseSystems
      Line3Phase LR;
      Source3Phase S(shift=0);
      Source3Phase SS(shift=0.4);
    equation
      connect(SS.P, LR.P);
      connect(LR.N, S.P);
    end Test3PhaseSystems;

    model Test3PhaseSystemsInit
      Line3PhaseInit LR;
      Source3Phase S(shift=0);
      Source3Phase SS(shift=0.4);
    equation
      connect(SS.P, LR.P);
      connect(LR.N, S.P);
    end Test3PhaseSystemsInit;

    model Test3PhaseSystemsInit1
      Line3Phase LR1;
      Line3Phase LR2;
      Source3Phase S(shift=0);
      Source3Phase SS(shift=0.4);
    initial equation
      der(LR1.i_dq0)={0,0,0};
    equation
      connect(SS.P, LR1.P);
      connect(LR1.N, LR2.P);
      connect(LR2.N, S.P);
    end Test3PhaseSystemsInit1;

    model Test3PhaseSystemsOverdetermined
      Line3PhaseInit LR1;
      Line3PhaseInit LR2;
      Source3Phase S(shift=0);
      Source3Phase SS(shift=0.4);
    equation
      connect(SS.P, LR1.P);
      connect(LR1.N, LR2.P);
      connect(LR2.N, S.P);
    end Test3PhaseSystemsOverdetermined;
end Test3PhaseSystemsOverdetermined;
